import React from 'react';
import Input from './Input';


const Fields = React.forwardRef(({ type, ...rest }, ref) => {
    switch (type) {
        case "text":
        case "password":
        case "email":
            return <Input type={type} ref={ref} {...rest} />
        default:
            break;
    }
}
)

export default Fields;
